import React from 'react';
import { Link } from 'react-router-dom';

const Navigation = () => (
    <div style = {styles.navBarStyle}>
        <h4 style= {styles.appNameStyle}>App Name</h4>
        <input
            style = {styles.searchStyle}
        />
        <ul>
            <li style={styles.listStyle}>
                <Link 
                    style={styles.textStyle} 
                    to='/'>
                    Home
                </Link>
            </li>
            <li style={styles.listStyle}>
                <Link 
                    style={styles.textStyle} 
                    to='/signin'>
                    Sign In
                </Link>
            </li>
            <li style={styles.listStyle}>
                <Link 
                    style={styles.textStyle} 
                    to='/signup'>
                    Sign Up
                </Link>
            </li>
        </ul>
    </div>
);

const styles = {
    navBarStyle: {
        height: '10vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        flexDirection: 'row',
        backgroundColor: '#FAFAFA'
    },
    listStyle: {
        display: 'inline',
        padding: 20
    },
    listContainer: {
        flexBasis: '33%'  
    },
    textStyle: {
        textDecoration: 'none',
        color: '#454545',
        fontFamily: 'merriweather'
    },
    searchStyle: {
        flexBasis: '33%'
    },
    appNameStyle: {
        flexBasis: '33%'
    }
}

export default Navigation;
